    notes:
      '* Due to several character stats needing to be recalculated each time a character spawns, casting <i>Wish</i> immediately upon respawning will cause its cooldown to be unaffected by ability haste, and the healing will not be increased by <b>Soraka\'s</b> <span style="color: #7A6DFF; white-space:normal">ability power</span>. <sup><span style="border-bottom:1px dotted gray;cursor:help;" title="This is not intended." class="basic-tooltip">(bug)</span></sup>\n<ul><li><span class="glossary" style="white-space:pre; position:relative;" data-game="lol" data-tip="Untargetable"><a title="Untargetable" href="/wiki/Untargetable"><img alt="Untargetable icon" class="lazyload" loading="lazy" height="20" data-relevant="0" decoding="async" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-image-name="Untargetable icon.png" data-image-key="Untargetable_icon.png" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/4/41/Untargetable_icon.png/revision/latest/scale-to-width-down/20?cb=20220206063243" width="20"></a> <a title="Untargetable" class="mw-redirect" href="/wiki/Untargetable">Untargetability</a></span> does not invalidate the targeting of the heal.</li>\n<li><i>Wish</i> will not credit <b>Soraka</b> for <a href="/wiki/Assist" title="Assist">assisting</a> in a <a title="Kill" href="/wiki/Kill">champion kill</a> if the target ally is at full health.</li>\n<li><i>Wish</i> will apply heal effects (such as <span style="display:inline;white-space:pre;" data-param="" class="inline-image label-after rune-icon" data-rune="Summon Aery" data-game="lol"><span style="display:inline-block;position:relative;" data-width="20"><a title="Summon Aery" href="/wiki/Summon_Aery_(Rune)"><img data-src="https://static.wikia.nocookie.net/leagueoflegends/images/d/d7/Summon_Aery_rune.png/revision/latest/scale-to-width-down/20?cb=20171126182228" data-image-name="Summon Aery rune.png" class="lazyload" alt="Summon Aery" data-relevant="1" width="20" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" decoding="async" loading="lazy" data-image-key="Summon_Aery_rune.png" height="20"></a></span> <span style="word-break: keep-all;;"><a class="mw-redirect" title="Summon Aery (Rune)" href="/wiki/Summon_Aery_(Rune)">Summon Aery</a></span></span>) prioritizing targets based on the <i>Spawn ID</i>, which is the order in which units were added to an ongoing game. For <span style="white-space:pre; position:relative;" data-game="lol" data-tip="Champions" class="glossary"><a title="Champion" href="/wiki/Champion"><img src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" loading="lazy" width="20" decoding="async" height="20" data-image-key="Champion_icon.png" class="lazyload" data-image-name="Champion icon.png" alt="Champion icon" data-relevant="0" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/2/25/Champion_icon.png/revision/latest/scale-to-width-down/20?cb=20181122022630"></a> <a title="Champion" href="/wiki/Champion">champions</a></span>, this is the order they appear in from left to right in the loading screen.</li>\n<li><i>Wish\'s</i> effects occur before the cast time.</li></ul>',
